// src/Pages/DataPage.jsx
import Sidebar from "../Components/Sidebar";

export default function DataPage() {
  // TODO: Add handlers for generating routes & resetting sensors
  // TODO: Conditionally render admin-only tools based on user role

  return (
    <div className="flex min-h-screen bg-black text-white">
      <Sidebar />
      <main className="flex-1 p-8">
        <h2 className="text-4xl font-extrabold text-cyan-400 mb-6">Data Management</h2>

        <div className="space-x-4 mb-8">
          <button 
            className="bg-cyan-500 hover:bg-cyan-600 p-3 rounded-xl font-semibold transition"
            // TODO: onClick={handleGenerateRoute}
          >
            Generate New Route
          </button>
          <button 
            className="bg-cyan-500 hover:bg-cyan-600 p-3 rounded-xl font-semibold transition"
            // TODO: onClick={handleResetSensors}
          >
            Reset Sensors
          </button>
        </div>

        <h3 className="text-2xl font-bold mb-4">Admin Tools</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
          <button className="bg-cyan-600 hover:bg-cyan-700 p-3 rounded-xl transition">
            {/* TODO: Navigate to manage routes */}
            • Manage Routes
          </button>
          <button className="bg-cyan-600 hover:bg-cyan-700 p-3 rounded-xl transition">
            {/* TODO: Navigate to view route requests */}
            • View Route Requests
          </button>
          <button className="bg-cyan-600 hover:bg-cyan-700 p-3 rounded-xl transition">
            {/* TODO: Navigate to manage sensors */}
            • Manage Sensors
          </button>
        </div>
      </main>
    </div>
  );
}
